64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36','127.0.0.1',' We do apply a nominal charge of CAD 4 (inclusive of service tax @ 15%) for amounts of CAD 1500 or below for electronic credits into bank accounts and for issuing DDs to over 700 locations. No remittance service charge is applicable for higher amounts. Do bear in mind that your local bank may charge you for the wire transfer.  <span class=\"sfShowMore\"></span>\n\n Service tax will be levied on the converted gross INR amount in accordance with the Finance Act, 2015 and Service Tax (Amendment) Rules',NULL,0,0,0,'/ChatEngine/chatm2i.html','pending',94,NULL),(3988,1,'Unknown','ECB7C061DC96CF88BE4AF412EAF6F0C4','Money2India - How do I start using Money2India services?','','','2016-10-28 11:40:22','','computer (UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36)UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36','127.0.0.1',' On visiting the Money2India.com website, click on \'New Users\' and \'Get Started\' on registering for our services. It is a simple online process, wherein you need to provide your personal / contact details and choose your unique user ID and password. Once done, you can start using our facilities for your money transfer needs. Do contact the Money2India Customer Service team for any assistance.<i title=\"null\">.</i>',NULL,0,0,0,'/ChatEngine/chatm2i.html','pending',94,NULL),(3989,1,'Unknown','ECB7C061DC96CF88BE4AF412EAF6F0C4','Canada - eTransfer - Can my bank in Canada reject a money transfer request made by me using eTransfer (ACSS)?','','','2016-10-28 11:40:32','','computer (UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36)UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safar