4AEF4402C7CF625B','what are tha charges for e transfer','','','2016-11-24 07:10:26','','computer (UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36)UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36','127.0.0.1',' We do apply a nominal charge of CAD 4 (inclusive of service tax @ 15%) for amounts of CAD 1500 or below for electronic credits into bank accounts and for issuing DDs to over 700 locations. No remittance service charge is applicable for higher amounts. Do bear in mind that your local bank may charge you for the wire transfer.  <span class=\"sfShowMore\"></span>\n\n Service tax will be levied on the converted gross INR amount in accordance with the Finance Act, 2015 and Service Tax (Amendment) Rules',NULL,0,0,0,'/N_ICICIM2I/chatm2i.html','pending',94,NULL),(4492,1,'Unknown','0B3C00CD04ADA83F4AEF4402C7CF625B','what are the timelines','','','2016-11-24 07:10:32','','computer (UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36)UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36','127.0.0.1',' Our e-Transfer mode of remittance takes 5 business days from the date of remittance request through Money2India e-Transfer (ACH). This is excluding Saturdays, Sundays, and public holidays in India and USA/ Canada and first day of transfer. Since ICICI Bank is not a member of ACH, transactions are routed through our correspondent banks. This takes 5 business days after which, the status can be updated in the tracking screen, which can be checked in the \'Track Transfer\' page.<i title=\"null\">.</i',NULL,0,0,0,'/N_ICICIM2I/chatm2i.html','pending',94,NULL),(4493,1,'Unknown','0B3C00CD04ADA83F4AEF4402C7CF625B','Canada - eTransfer - Can my bank in Canada reject a money transfer request made by me using eTransfer (ACSS)?','','','2016-11-24 07:10:34','','computer (UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36)UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36','127.0.0.1',' Your bank in Canada might return your e-Transfer (ACSS) request for various reasons, which include insufficient funds in your account and any change in your account status (account closed / disabled / type changed). Do note that your bank might levy a charge in case you do not have sufficient funds in your account to cover the amount to be transferred. <a class=links href=\'https://www.icicibank.com/nri-banking/money_transfer/canada/e-transfer-acss.page\' target=\'_blank\'>Click here</a> to know m',NULL,0,0,0,'/N_ICICIM2I/chatm2i.html','pending',94,NULL),(4494,1,'Unknown','0B3C00CD04ADA83F4AEF4402C7CF625B','Canada - eTransfer - What type of bank accounts in Canada can be used for eTransfer?','','','2016-11-24 07:10:41','','computer (UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36)UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36','127.0.0.1',' Our e-Transfer (ACSS) cannot be used for business / commercial bank accounts.<i title=\"null\">.</i><hr><hr>\nSFKKAKSMHSF1. <a href=\"javascript:autosubmit(\'Canada - eTransfer - What type of bank accounts in Canada can be used for eTransfer?\')\">Canada - eTransfer - What type of bank accounts in Canada can be used for eTransfer?</a><br>\nSFKKAKSMHSF2. <a href=\"javascript:autosubmit(\'Canada - eTransfer - Can my bank in Canada reject a money transfer request made by me using eTransfer (ACSS)?\')\">Canad',NULL,0,0,0,'/N_ICICIM2I/chatm2i.html','pending',94,NULL),(4495,1,'Unknown','0B3C00CD04ADA83F4AEF4402C7CF625B','Canada - eTransfer - What type of bank accounts in Canada can be used for eTransfer?','','','2016-11-24 07:10:46','','computer (UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36)UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36','127.0.0.1',' You can use our e-Transfer facility if you have a consumer checking account or a consumer savings account with a bank affiliated to the ACSS network in Canada. You can also use your consumer money market accounts for online transfers.<i title=\"null\">.</i><hr><hr>\nSFKKAKSMHSF1. <a href=\"javascript:autosubmit(\'eTransfer - How does the eTransfer (ACSS) process work?\')\">eTransfer - How does the eTransfer (ACSS) process work?</a><br>\nSFKKAKSMHSF2. <a href=\"javascript:autosubmit(\'Canada - eTransfer ',NULL,0,0,0,'/N_ICICIM2I/chatm2i.html','pending',94,NULL),(4496,1,'Unknown','0B3C00CD04ADA83F4AEF4402C7CF625B','Canada - eTransfer - I have a business checking account. Can I send money to India using eTransfer (ACSS) from this account?','','','2016-11-24 07:10:43','','computer (UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36)UnKnown, More-Info: Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.82 Safari/537.36','127.0.0.1',' You can use our e-Transfer facility if you have a consumer checking account or a consumer savings account with a bank affiliated to the ACSS network in Canada. You can also use your consumer money market accounts for online transfers.<i title=\"null\">.</i><hr><hr>\nSFKKAKSMHSF1. <a href=\"javascript:autosubmit(\'eTransfer - How does the eTransfer (ACSS) process work?\')\">eTransfer - How does the eTransfer (ACSS) process work?</a><br>\nSFKKAKSMHSF2. <a href=\"javascript:autosubmit(\'Canada - eTransfer ',NULL,0,0,0,'/N_ICICIM2I/chatm2i.html','pending',94,NULL),(4497,1,'Unkn